import React from "react";

const Navigation = ({ onRouteChange, isSignedIn }) => {
        if (isSignedIn) {
          return (
            <nav style={{display: "flex", justifyContent: "flex-end"}}>
                <p onClick={() => onRouteChange('signout')} className="f3 link dim black underline pa1 pointer ma1">Sign Out</p>
            </nav> 
          )
         } else {
            return (
                <nav style={{display: "flex", justifyContent: "flex-end"}}>
                <p onClick={() => onRouteChange('Signin')} className="f3 link dim black underline pa1 pointer ma1">Sign In</p>
                <p onClick={() => onRouteChange('register')} className="f3 link dim black underline pa1 pointer ma1">Register</p>
            </nav>
            );
         }

}

export default Navigation; 

